Subscripts
Introduction
Welcome to lesson 7 of The Swift Fundamentals with Bob. What if I told you that you may create a shortcut? I know it sounds abstract. Let's learn more.
Problem
I'd love to have a shortcut instead of calling a method.
Normal Method
Create a class called, HelloKitty which contains a method that returns a string value.
struct HelloKitty {
  func saySomething() -> String {
    return "I'm Cute"
  }
}

Create an instance and call saySomething()
let babe = HelloKitty()
babe.saySomething()

Introducing Subscripts
A subscript provide shortcuts. It is analogous to creating a method. There is no name to it.
struct WeekDays {
  var days = ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"]

  subscript(index: Int) -> String {
    return days[index]
  }  
}

Shortcut
Call the subscript by entering [].
let myDays = WeekDays()
myDays[0]  // "Monday"
myDays[1]  // "Tuesday"

Dictionary
When you access elements in a dictionary, it always returns an optional type.
var info = ["Height": 183, "Body Fat": 12.5, "Weight": 76]
let height = info["Height"] // height is an optional string

Artificial Dictionary Subscript
Access element without returning an optional type
struct HealthInfo {
  var info = ["Height": 183, "Body Fat": 12.5, "Weight": 76]

  subscript(key: String) -> Double {
    if let newInfo = info[key] {
      return newInfo
    } else {
      return 0
    }
  }
}

Access Elements
Return non-optionals using the subscript method.
let bob = HealthInfo()
bob["Height"]         // 183
bob["Body Fat"]        // 12.5
bob["123456789"]       // 0

Shortcoming of Subscript
No context means = ☠️
Practical Usage

Get the number of rows in table/collection
Anything has to do with pairs and collection types

Source Code
1107_subscripts.playground
Conclusion
Now you understand what I meant by creating a shortcut. However, subscripts can be misleading because there is no name to it. I recommend not to overuse it.
Swift engineers recommend that, brevity is not the worthwhile goal. Effective communication trumps everything else.

course/swift-intermediate/extension.html.body:
Extension
Introduction
Welcome to Lesson 10 of The Swift Fundamentals. You are going to learn that  Swift extension provides extra power to structs, classes, and enums
Problem
I like to keep it short and modularized. Prevent Massive Class
Design Struct
First, design a struct called, Bob. It contains two initialized properties: name and skill.
struct Bob {
  var name = "Bob"
  var skill = "Work"

  init() {}
}

Bob().name // "Bob"

Extend Class
You may add all kinds to the Bob struct. However, you may not add stored properties.
extension Bob {
  var description: String {
    let myName = self.name
    let mySkill = self.skill // object.name
    return "I'm \(name), I know \(skill)"
  }

  init(enterSkill: String) {
    self.skill = enterSkill
    print("You've entered a new skill")
  }

  subscript(mySkill: String) -> String {
    return "This is your secret weapon"
  }
}

Check
let bob = Bob()
bob.description // I'm Bob, I know work"

Use the init(enterSkill: String) init method from extension.
let newBob = Bob(enterSkill: "Drawing")
newBob.description // I'm Bob, I know drawing"

Extension to Swift Types

Remember, Int just a struct

extension Int {
  var squared: Int {
    return self * self
  }
}

self refers to the object created by the struct.
let myNumber = 10 // self is 10
myNumber.squared // 100

The Rule

You may not have a stored property

The Scope
As mentioned, extension allow developers to implement all kinds. 

Add computed instance properties and computed type properties (2002_computed_property)
Define instance methods and type methods (2007_type_property_method)
Provide new initializers
Define subscripts (1007_subscripts)
Define and use new nested types with enum/struct (Later)
Make an existing type conform to a protocol (Later)


This is super useful. But, when protocols meet extensions, it becomes &#x1F631;

