Convenience Init
Introduction
Welcome to the first lesson of Object Oriented Swift. In this lesson, you will learn how to become lazy.  In other words, you learn to become smart and effective when it comes to initializing an object. In programming, getting lazy to write less code is in fact good for your teammates and users as long as it's readable. Bill Gates once mentioned, whenever there is hard work to be done, he assigns it to the laziest person as he or she is sure to find an easy way of doing it. So, let's get started.
Problem
I'm lazy. Can we initialize quickly?
Create Class with Designated Init
Create a class called Human
class Human {
  var name: String
  init(name: String) {
    self.name = name
 }

  // Convenience init intializes the designated init method
  convenience init() {
    self.init(name: "Bob Lee")
  }
}

Convenience init initializes the designated init method by calling self.init.
Create Object
let lee = Human(name: "Bob Lee") // init(name: String)
let bob = Human() // Convenience init()

Initialize UIColor
Create an instance that stores UIColor.
import UIKit

let randomColor = UIColor(colorLiteralRed: 255/255, green: 80/255, blue: 85/255, alpha: 1)

Custom Convenience Init
Create our own convenience init that initializes the designated init by adding extension to UIColor.
extension UIColor {
 convenience init(r: Float, g: Float, b: Float) {
   self.init(colorLiteralRed: r/255, green: g/255, blue: b/255, alpha: 1)
 }
}

let myFavoriteColor = UIColor(r: 255, g: 80, b: 85)

Application

Useful for quick initialization for open source projects
Custom convenience like UIKIt

Source Code
2001_convenience_init.playground
Conclusion
You've learned how to become lazy and effective at the same time. Imagine you are creating a library for your teammates to use. They no longer have to use a designated init method to initialize an object. It's  not necessary. It's a win-win situation. In the next lesson, let's talk about how initialization may fail.

course/object-oriented-swift/computed-pr.body:
Computed Property
Introduction
Welcome to Lesson 3 of Object Oriented Swift. Today, we are going to learn how to create relationships between variables. So that you don't need to manage two or more variables separately. Are you confused? Well, have you heard, get and set before? Haven't? No worry. I will walk you through by placing your feet on mine. Let's dive into it.
Problem
Do we have to make functions all the time to calculate something?
Atrocious Code
Unrelated functions that take up many lines. The functions below are used to calculate radius.
func getDiameter(radius: Double) -> Double {
 return radius * 2
}
func getRadius(diameter: Double) -> Double {
 return diameter / 2
}

getDiameter(radius: 10) // return 20
getRadius(diameter: 200) // return 100
getRadius(diameter: 600) // return 300

Introducing Computed Property
You may create a variable that only can be read. You may not customize. It is also referred to as a gettable property.

Computed = calcualted

Gettable Property
Create a only readable property.
class NumberClass {
  var readableNumber: Double {
    get {
      // Complex logic
      return 777
    }
  }
  var readableNumbers: Double {
    return 789
  }
}

If you attempt to modify the property, it will give you an error.
readableNumber = 10 // Error
readableNumbers = 20 // Error

Gettable and Settable Property
You may not only make a property gettable, but also settable by inserting set right after get.  Let us create a relationship between radius and diameter.
var radius: Double = 10
var diameter: Double {
  get {
    return radius * 2
  }
  set {
    radius = newValue / 2
  }  
}

diameter = 50
radius = 100
diameter // 200

Now, if you set diameter to 100,  newValue becomes 100. As a result, radius will be 50. If you set radius to 500, diameter will be 1000.
Instead of calling newValue, you may name the recently set value as you wish. In the example below, there is a relationship between area and side. Instead of calling newValue, I call it as newArea.
import Foundation

var side: Double = 100
var area: Double {
 get {
   return side * side
 }
 set(newArea) {
   side = sqrt(newArea)
 }
}

area = 1000
side // 31.6

